            if (Pilots == null)
            {
                Pilots = await Utils.HttpGetAsync<IEnumerable<Pilots>>(Http, ApiTypeService.game, ApiService.GetPilots);
                Pilots = Pilots.OrderByDescending(o => o.Experience);
                await localStorage.SetItemAsync("allPilots", Pilots);
            }
        }
